import React from "react";
import ReactDOM from "react-dom/client"; // Importação correta para React 18
import App from "./App"; // Importa o componente principal da aplicação
import { BrowserRouter } from "react-router-dom"; // Garante que as rotas funcionem corretamente

// Obtém a referência do elemento "root" no HTML
const root = ReactDOM.createRoot(document.getElementById("root"));

// Renderiza a aplicação dentro do BrowserRouter para gerenciar as rotas
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </React.StrictMode>
);
